import { StyleSheet } from 'react-native';

const DataContainerStyles = StyleSheet.create({
    dataContainer: {
        width: '100%',
        marginTop: '4%',
        height: '100%',
        backgroundColor: '#2A3C44',
        borderTopRightRadius: 40,
        shadowColor: "#000",
        shadowOffset: {
            width: 0,
            height: 12,
        },
        shadowOpacity: 0.58,
        shadowRadius: 16.00,
        elevation: 24,
        flex: 1
    }
})

export default DataContainerStyles
